import React from 'react';
import MyPosts from './MyPosts';
import { arajin, erkrord } from '../../../redux/mr.js';
import StoreContext from '../../../StoreContext';

const PostsMy = (props) => {
  let state = props.store.getState();

  let add = () => {
    props.store.dispatch(arajin());
  };

  let change = (text) => {
    let ac = erkrord(text);
    props.store.dispatch(ac);
  };

  return (
    <MyPosts
      change={change}
      add={add}
      mymsg={state.messagePage.mymsg}
      adText={state.messagePage.adText}
    />
  );
};

export default PostsMy;
